  declarations: [
    AppComponent,
    ProjectFormComponent,
    StatusFormComponent,
    TaskManagementComponent,
    HeaderComponent,
    AboutUsComponent,

    AllProjectsComponent,


        ProjectDetailsComponent,

                        UpdateProjectComponent,
                        AddStatusComponent,
                        ProjectStatusChartComponent,


  ],
  imports: [
    BrowserModule,
    FormsModule,
    HttpClientModule,
    AppRoutingModule,
    ReactiveFormsModule,

  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
